#include <iostream>#include <cmath>using namespace std;#define EPS 1.0E-9bool equalsT(double a, double b) {	return fabs(a - b) < EPS;}bool lessT(double a, double b) {	return (a - b) < EPS;}bool greaterT(double a, double b) {	return (b, a);}int main() {	int t;	int ai1, ai2, di1, di2, li1, li2;	double a, b, bon;	cin >> t;	while (t--) {		cin >> bon >> ai1 >> di1 >> li1 >> ai2 >> di2 >> li2;		a = (ai1 + di1)/2.0 + (li1%2 ? 0 : bon);		b = (ai2 + di2)/2.0 + (li2%2 ? 0 : bon);		if (equalsT(a, b)) {			printf("Empate\n");		} else if (lessT(a, b)) {			printf("Guarte\n");		} else {			printf("Dabriel\n");		}	}	return 0;}
